import React from 'react'
import { Navbar, Nav } from 'react-bootstrap';
import "./NavBar.css"

function NavbarComponent() {

  function handleSelected()
  {

  }


  return (
      <Navbar expand="lg" style={{ backgroundColor: "#A8DADC" }}>
        <Navbar.Brand
        style={{marginLeft:"20px"}}>Stock Tracker</Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav" className='justify-content-end'>
          <Nav className="mr-auto"></Nav>
          <Nav>
            <Nav.Link href="/search" className='nav-select' onSelect={handleSelected} style={{backgroundColor:"#f1faee", borderRadius:"5px"}}>Search</Nav.Link>
            <Nav.Link href="/watchlist" className='nav-select'>Wishlist</Nav.Link>
            <Nav.Link href="/portfolio" className='nav-select'>Portfolio</Nav.Link>
          </Nav>
        </Navbar.Collapse>
      </Navbar>
    );
  }






export default NavbarComponent;
